function myFunction(id) {
	$.ajaxSetup({async:false});  //execute synchronously
    $.ajax({
		type: "post", 
		url: 'getBooking.php',
		data: {
			booking_id: id
		},
		dataType: 'json',
		success: function(data){
			row =  data[0];


			$('[name=booking_id]').val(row['booking_id']);
			$("[name=room] option[value="+row['room_id'] +"]").attr("selected",true);
			$("[name=room] option[value="+row['room_id'] +"]").val(row['room_id']).change();
			
			
			$('[name=label]').val(row['label']);
			$("[name=color] option[value="+row['color'] +"]").attr("selected",true);
			$("[name=color] option[value="+row['color'] +"]").val(row['color']).change();
			
			
			$('[name=idhuespedes]').val(row['idhuespedes']);
			$('[name=name]').val(row['name']);
			$('[name=quantity]').val(row['quantity']);
			
			$("[name=country] option[value="+row['idpaises'] +"]").attr("selected",true);
			$("[name=country] option[value="+row['idpaises'] +"]").val(row['idpaises']).change();
			
			$('[name=email]').val(row['email']);
			$('[name=notes]').val(row['note']);
			
			$("[name=idservicios] option[value="+row['idservicios'] +"]").attr("selected",true);
			$("[name=idservicios] option[value="+row['idservicios'] +"]").val(row['idservicios']).change();

			$("[name=idresponsablesDepago] option[value="+row['idresponsablesDepago'] +"]").attr("selected",true);
			$("[name=idresponsablesDepago] option[value="+row['idresponsablesDepago'] +"]").val(row['idresponsablesDepago']).change();
			
			$("[name=idresponsable] option[value="+row['idresponsable'] +"]").attr("selected",true);
			$("[name=idresponsable] option[value="+row['idresponsable'] +"]").val(row['idresponsable']).change();
			
			$('[name=price]').val(row['price']);
			$('[name=pay]').val(row['pay']);
			
			$("[name=currency] option[value="+row['currency'] +"]").attr("selected",true);
			$("[name=currency] option[value="+row['currency'] +"]").val(row['currency']).change();

			$('[name=valor]').text(row['data']);
			$('#periodSelected').val(row['data']);
			$('[name=accion]').val('bookingModify');
			var dataIN = row['data'].split(' - ')[0];

			if(row['status'] == 0 && ((dataIN == <?php echo "'" . ucwords(strftime("%d %B %Y")). "'"?>) || (dataIN == <?php echo "'" . ucwords(strftime("%d %B %Y", strtotime('yesterday'))). "'"?>))){
				
				$('#check').show();
				$("#check").removeClass( "btn btn-warning" );
				$("#check").removeClass( "btn btn-info" );
				$('#check').toggleClass( "btn btn-warning" )
				$("#check").attr('onclick', 'check_in(' + row['booking_id'] + ')');
				$("#check").html('Check-In');
			}
			else if(row['status'] == 1)
			{
				
				$('#check').show();
				$("#check").removeClass( "btn btn-warning" );
				$("#check").removeClass( "btn btn-info" );
				$('#check').toggleClass( "btn btn-info" )
				$("#check").attr('onclick', 'check_out(' + row['booking_id'] + ')');
				$("#check").html('Check-Out');
			}
			else{
				$("#check").hide();
			}

			$("#deleteButton").data('id', row['booking_id']);
			

			if(11 == <?php echo $_SESSION['idusuarios_tipos']?>)
			{
				$('[name=next]').hide();
				$("#deleteButton").hide();
			}
			else{
				$("#deleteButton").show();

			}


			$('#cEdit').show();
			
		}
	});
	
	$.ajaxSetup({async:true});  //return to default setting

}

function cancelEdit(){
	$("[name=room] option:selected").removeAttr("selected");
	$("[name=room] option:first").attr("selected",true);
	$("[name=room] option:first").val($("[name=room] option:first").val()).change();


	$('[name=label]').val('');

	$("[name=color] option:selected").removeAttr("selected");
	$("[name=color] option:first").attr("selected",true);
	$("[name=color] option:first").val($("[name=color] option:first").val()).change();


	if(<?php echo $_SESSION['idusuarios_tipos']?> != 11)
	{
		$("[name=idresponsablesDepago] option:selected").removeAttr("selected");
		$("[name=idresponsablesDepago] option:first").attr("selected",true);
		$("[name=idresponsablesDepago] option:first").val($("[name=idresponsablesDepago] option:first").val()).change();


		$("[name=idresponsable] option:selected").removeAttr("selected");
		$("[name=idresponsable] option:first").attr("selected",true);
		$("[name=idresponsable] option:first").val($("[name=idresponsable] option:first").val()).change();
	}
	else{

		$("[name=idresponsablesDepago] option:last").attr("selected",true);
		$("[name=idresponsablesDepago] option:last").val($("[name=idresponsablesDepago] option:last").val()).change();

		$("[name=idresponsable] option[value="+ <?php echo $_SESSION['employee_id']?> +"]").attr("selected",true);
		$("[name=idresponsable] option[value="+<?php echo $_SESSION['employee_id']?> +"]").val(<?php echo $_SESSION['employee_id']?>).change();

	}


	



	$('[name=idhuespedes]').val('');
	$('[name=name]').val('');
	$('[name=quantity]').val('');

	$("[name=country] option:selected").removeAttr("selected");
	$("[name=country] option:first").attr("selected",true);
	$("[name=country] option:first").val($("[name=country] option:first").val()).change();

	$('[name=email]').val('');
	$('[name=notes]').val('');


	$("[name=idservicios] option:selected").removeAttr("selected");
	$("[name=idservicios] option:first").attr("selected",true);
	$("[name=idservicios] option:first").val($("[name=idservicios] option:first").val()).change();


	$('[name=price]').val('');
	$('[name=pay]').val('');

	$("[name=currency]  option:selected").removeAttr("selected");
	$("[name=currency] option:first").attr("selected",true);
	$("[name=currency] option:first").val($("[name=currency] option:first").val()).change();

	$('[name=valor]').text('');
	$('#periodSelected').val('');
	$('[name=accion]').val('bookingNew');






	$('#cEdit').hide();
	$('#check').hide();
	$('[name=next]').hide();

}

