<script>
	function check_in(id)
	{
		document.getElementById('modal-header').innerHTML=' <button data-dismiss="modal" class="close" type="button"></button><h3><span class="icon"> <i class="icon-check"></i> </span>Check-in</h3>';
		document.getElementById('modal-body').innerHTML='<object id=foo name=foo type=text/html width=530 height=350 data=doCheckin.php?id=' + id + '></object>';
	}

	function check_out(id)
	{
		document.getElementById('modal-header').innerHTML=' <button data-dismiss="modal" class="close" type="button"></button><h3><span class="icon"> <i class="icon-check"></i> </span>Check-out</h3>';
		document.getElementById('modal-body').innerHTML='<object id=foo name=foo type=text/html width=530 height=350 data=doCheckout.php?id=' + id + '></object>';
	}

	setInterval(function() {
        $.ajaxSetup({async:false});  //execute synchronously
	    $.ajax({
			type: "post", 
			url: 'getBookingMap.php',
			data: {
				updated_at: '<?php echo $last_booking; ?>'
			},
			dataType: 'json',
			success: function(data){
				if(data == 'update_available')
				{
					location.reload();
				}
				
				
			}
		});
		
		$.ajaxSetup({async:true});  //return to default setting
    }, 60 * 1000);


	$('#check').hide();
	$('#cEdit').hide();
	$('#deleteButton').hide();

	$('#gantt-data').scrollLeft(<?php echo date('t', strtotime('last day of last month'));?> * 35);
	$('.textarea_editor').wysihtml5();

	$('#delete').on('show', function() {
		var id = $(this).data('id'),
		
        removeBtn = $(this).find('.btn-danger');

        removeBtn.attr('href', removeBtn.attr('href').replace(/(&|\?)ref=\d*/, '$1ref=' + id));
    
    	$('#debug-url').html('Seguro que deseja Apagar a reserva N <strong>' + id + '</strong>?');


	});

	$('.confirm-delete').on('click', function(e) {
		e.preventDefault();

		var id = $(this).data('id');

		$('#delete').data('id', id).modal('show');
	});
	
	$("#delete").on("click", "#deleteBooking", function() {
		
		$.ajaxSetup({async:false});  //execute synchronously
	    $.ajax({
			type: "post", 
			url: 'deleteBooking.php',
			data: {
				booking_id: row['booking_id']
			},
			dataType: 'json',
			success: function(data){
				location.reload();
			}
		});
		
		$.ajaxSetup({async:true});  //return to default setting
    });
</script>

